INSERT INTO `pubs` VALUES ('Pour obtenir des points boutique, nous vous invitons à voter afin d\'être bien classé dans le classement RPG-Paradize. Vous pouvez aussi acheter des points boutiques sur le site !', '1');
INSERT INTO `pubs` VALUES ('Afin d\'être informé sur l\'actualité d\'Aestia, nous vous invitons à vous inscrire sur le forum et vous y rendre au moins 1 fois par jour !', '1');
INSERT INTO `pubs` VALUES ('Vous souhaitez savoir si un drop est disponible ? Pas de problème, rendez-vous <a href=\'http://aestia.eu/index.php/viewdrop\'>ici</a> !', '1');
INSERT INTO `pubs` VALUES ('Vous rencontrez un bug ? Rendez-vous sur le forum et postez-y votre problème, il sera traité le plus rapidement possible.', '1');
INSERT INTO `pubs` VALUES ('Nous vous conseillons de respecter les canaux respectifs afin de rendre utile les filtres. Tout non respect de cette règle de communauté sera puni ou averti d\'un mute.', '1');
INSERT INTO `pubs` VALUES ('La communication est importante afin de vous informez des dernières nouveautés ou des problèmes actuels récent ou futur, pour cela, nous vous conseillons de nous rejoindre sur les réseaux sociaux tels que <a href=\"https://www.facebook.com/Aestia-447842705416732/\"><u>Facebook</u></a> et <a href=\"https://twitter.com/Aestia_eu\"><u>Twitter</u></a> en cliquant sur l\'un ou l\'autre !', '1');
INSERT INTO `pubs` VALUES ('<u>Le saviez-vous ?</u> Aestia favorise ses joueurs en leur assurant une durée de vie de jeu longue, correcte et sympathique grâce à l\'entraide qui règne, soyez-raisonnable !', '1');
INSERT INTO `pubs` VALUES ('<u>Le saviez-vous ?</u> Les mises à jour du jeu sont fait en fonction des rapports signalé, ils sont corrigé rapidement quand un maximum de précision est présente. Tout ça informer sur le forum <a href=\"http://aestia.eu/forum/index.php?/topic/11-change-logs/#entry69\"><u>ici</u></a>.', '1');
